import React, {useState} from 'react'
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableWithoutFeedback,
	StatusBar,
	SafeAreaView,
	Keyboard,
	TouchableOpacity,
	KeyboardAvoidingView,
	Dimensions,
	TouchableHighlight,
} from "react-native";
import DropDownPicker from "react-native-dropdown-picker";
import Logo from '../assets/images/glow-modified.png'
import { LinearGradient } from "expo-linear-gradient";
import { BlurView } from "expo-blur";
import { TextInput } from "react-native-paper";


const UserRegistration = () => {
	const [open, setOpen] = useState(false);
	const [value, setValue] = useState(
		"Gender"
	);
	const [item, setitem] = useState(
		[{
			label:"Male", value:"male", parent:"Gender"
		},{
			label:"Female", value:"female",parent:"Gender"
		}]
	)
  return (
		<LinearGradient
			style={styles.container}
			colors={["#1F4690", "#646FD4"]}
			start={{
				x: 1,
				y: 1,
			}}
			end={{
				x: 0,
				y: 0,
			}}
		>
			<View
				style={{ flexDirection: "column", alignItems: "center", marginTop: 80 }}
			>
				<Image source={Logo} style={{ width: 80, height: 80 }}></Image>
				<View style={{ marginTop: 20, marginStart: 20 }}>
					<Text style={styles.Text}>Provide Your Some Details</Text>
					<Text style={styles.Text}>Get a To Lift Lae Ly Services </Text>
				</View>
				<BlurView
					intensity={75}
					style={{
						paddingBottom: 300,
						borderTopStartRadius: 15,
						borderTopEndRadius: 15,
						paddingLeft: 10,
						paddingRight: 10,
						marginTop: 20,
					}}
				>
					<Text
						style={{
							fontSize: 18,
							fontWeight: "bold",
							color: "white",
							marginStart: 10,
							paddingBottom: 10,
							marginTop: 10,
						}}
					>
						Full Name
					</Text>
					<TextInput
						label="Enter Tour Name"
						style={styles.input}
						placeholder="Ahmed Ali"
					/>
					<Text
						style={{
							fontSize: 18,
							fontWeight: "bold",
							color: "white",
							marginStart: 10,
							paddingBottom: 10,
							marginTop: 10,
						}}
					>
						Email
					</Text>
					<TextInput
						label="info@mail.com"
						style={styles.input}
						placeholder="Ahmed Ali"
					/>
					<Text
						style={{
							fontSize: 18,
							fontWeight: "bold",
							color: "white",
							marginStart: 10,
							paddingBottom: 10,
							marginTop: 10,
						}}
					>
						Gender
					</Text>
					<DropDownPicker
						open={open}
						value={value}
						items={item}
						setOpen={setOpen}
						setValue={setValue}
						setItems={setitem}
						mode="BADGE"
						multiple={true}
						
					/>
				</BlurView>
			</View>
		</LinearGradient>
	);
}
const android = Dimensions.get("window");
const styles = StyleSheet.create({
	container: {
		flex: 1,
		width: android.width,
		height: android.height * 1.5,
	},
	Text: {
		color: "white",
		fontSize: 28,
		fontWeight: "bold",
		textAlign: "center",
	},
	input: {
		
		borderTopLeftRadius: 20,
		borderBottomLeftRadius: 20,
		borderBottomRightRadius: 20,
		width: android.width * 0.94,
		height: 60,
		borderTopRightRadius: 20,
		shadowColor: "#000",
		shadowOffset: {
			width: 0,
			height: 3,
		},
		shadowOpacity: 0.29,
		shadowRadius: 4.65,

		elevation: 7,
	},
});

export default UserRegistration
